INSERT INTO `promotions` VALUES (1,'q6d9tpxilvs2o68w1vw0053y','S/ 45 por 60 minutos de juegos inflables con Fun Jungle El Derby - Santiago de Surco. !LUNES a DOMINGO!','Atracciones:\\n\\nJuegos inflables: Gladiators, Wild Bull, Melt Down, Free Fall, Brave Wave, Wrecking Ball, Extreme Jump, Crazy Maze, Ninja Wall, Splash Pond, Uphill Rush, Kapow, Toxic Twister, Free Fall, Pillar Challenge.\\n\\n\\n¡¡ PODRAS INGRESAR A TODOS LOS JUEGOS QUE DESEES DURANTE 60 MINUTOS !!\\n\\nLa oferta incluye:\\n\\nS/ 45 por:\\n1 entrada por 30 minutos minutos de juego donde podrás gozar cuantas veces quieras los juegos inflables de FUN JUNGLE - EL DERBY-SANTIAGO DE SURCO / LUNES A DOMINGO.',10,'* El ingreso a los inflables es por horarios, la espera está sujeta al orden de llegada y aforo.\\n* La altura mínima al ingreso del inflable es de 1m y/o edad mínima de 3 años, NO INCLUYE Splash Jungle ni Realidad Virtual .\\n* Adventure la altura mínima es de 1.20 m. Los jugadores de 1m hasta 1.20m ingresan acompañados de adulto durante toda la visita al parque. Todo jugador debe pagar su ingreso a los juegos.\\n* Promoción no incluye medias. Precio de medias 7.50 o S/8.00 según local . Es obligatorio, el uso de medias antideslizantes en los inflables.\\n* Válido de lunes a domingo en los horarios de atención al público. Visitar la siguiente página: https://funjungleparks.com/ para verificar horarios de atención y/o revisa nuestras redes sociales previamente a tu visita.\\n* Promoción válida respetando el reglamento y tallímetro de Fun Jungle en todos sus locales a nivel nacional.\",\n    ','JUEGA 60 MINUTOS POR S/45.00',55.00,45.00,100,'2025-06-10 17:49:33.314000','2025-06-10 17:53:02.310000',NULL,1,1,NULL),(3,'q6d9tpxilvs2o68w1vw0053y','S/ 45 por 60 minutos de juegos inflables con Fun Jungle El Derby - Santiago de Surco. !LUNES a DOMINGO!','Atracciones:\\n\\nJuegos inflables: Gladiators, Wild Bull, Melt Down, Free Fall, Brave Wave, Wrecking Ball, Extreme Jump, Crazy Maze, Ninja Wall, Splash Pond, Uphill Rush, Kapow, Toxic Twister, Free Fall, Pillar Challenge.\\n\\n\\n¡¡ PODRAS INGRESAR A TODOS LOS JUEGOS QUE DESEES DURANTE 60 MINUTOS !!\\n\\nLa oferta incluye:\\n\\nS/ 45 por:\\n1 entrada por 30 minutos minutos de juego donde podrás gozar cuantas veces quieras los juegos inflables de FUN JUNGLE - EL DERBY-SANTIAGO DE SURCO / LUNES A DOMINGO.',10,'* El ingreso a los inflables es por horarios, la espera está sujeta al orden de llegada y aforo.\\n* La altura mínima al ingreso del inflable es de 1m y/o edad mínima de 3 años, NO INCLUYE Splash Jungle ni Realidad Virtual .\\n* Adventure la altura mínima es de 1.20 m. Los jugadores de 1m hasta 1.20m ingresan acompañados de adulto durante toda la visita al parque. Todo jugador debe pagar su ingreso a los juegos.\\n* Promoción no incluye medias. Precio de medias 7.50 o S/8.00 según local . Es obligatorio, el uso de medias antideslizantes en los inflables.\\n* Válido de lunes a domingo en los horarios de atención al público. Visitar la siguiente página: https://funjungleparks.com/ para verificar horarios de atención y/o revisa nuestras redes sociales previamente a tu visita.\\n* Promoción válida respetando el reglamento y tallímetro de Fun Jungle en todos sus locales a nivel nacional.\",\n    ','JUEGA 60 MINUTOS POR S/45.00',55.00,45.00,100,'2025-06-10 17:49:33.314000','2025-06-10 17:53:02.310000','2025-06-10 17:53:02.368000',1,1,NULL);
